import React from "react";
// reactstrap components
import { Container, Row, Nav, NavItem, NavLink, Col, Button, Badge } from "reactstrap";

class Ratings extends React.Component {
  render() {
    return (
        <div className="content">
                      <section className="section section-lg">
            <Container>
              <Row className="row-grid align-items-center">
                <Col className="order-md-2" md="6">
                  <img
                    alt="..."
                    className="img-fluid floating"
                    src={require("assets/img/theme/refer.png")}
                  />
                </Col>
                <Col className="order-md-1" md="6">
                  <div className="pr-md-5">
                  <img
                    alt="..."
                    className="img-fluid floating"
                    src={require("assets/img/theme/rating-stars.png")}
                  />
                  <div className="list-unstyled mt-5">
                  <h1>What our customers are saying</h1>
                  </div>
                  <div class="icons-block d-flex">
            <div class="icon position-relative">
              <span><i class="fa fa-angle-left"></i></span>
            </div>
            <div class="icon position-relative">
              <span><i class="fa fa-angle-right"></i></span>
            </div>
          </div>
                  </div>
                </Col>
              </Row>
            </Container>
          </section>
            </div>
    );
  }
}

export default Ratings;
